import React from 'react'
import './Women.css'
import women_sec from '../Assets/women_sec.jpg'

const Women = () => {
  return (
    <div className='women'>
        <div className="women-section">
            <img src={women_sec} alt="" />
        </div>
      
    </div>
  )
}

export default Women
